import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'; // App 컴포넌트 import
import './index.css'; // index.css import

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
